import React from 'react';
import logo from '../images/web.png'

function Header() {
    return (
    <hgroup>
      <h1>Byte Sized Web</h1>
      <p>delicious snippets of code</p>
      <nav>
        <img className='logo' src={ logo } alt='logo'></img>
        <button>Home</button>
        <button>About</button>
        <button>Cheatsheets</button>
      </nav>
  </hgroup>
  )
}

